        <div className="d-flex flex-column align-items-center">
          <h3 className="p-3 text-center lh-1">Hola mundo, soy Mart√≠n Madridejos, <br></br> desarrollador web apasionado del mundo Front End</h3>
          <img src={Captura} alt="imagen" style={{ width: "200px", borderRadius: "100%" }}></img>
        
        </div>
        <Footer />
